import {useEffect, useRef} from "react";

function earth() {
    const earthRef = useRef(null);

    useEffect(() => {
        const earthElement = earthRef.current;
        if (earthElement) {
            const width = earthElement.offsetWidth;
            console.log("Размер earth:", width);
        }
    }, []);
    return (
        <div ref={earthRef}>
            <img src="/Icons/Landscape/earth.png" style={{ width: "100%", height: "100%" }}/>
        </div>
    )

}
export default earth;
